import React from 'react';
import { Container, Row, Col, Button, Card, CardBody, CardTitle, Modal, ModalHeader, ModalBody, ModalFooter, Media, Table } from "reactstrap";


//Import Breadcrumb
import Breadcrumbs from "../../../components/Common/Breadcrumb";

//i18n
import { withNamespaces } from 'react-i18next';

const SubmitProject = () => {
    return (

        <React.Fragment>
            <div className="page-content">
                <Container fluid>

                    {/* Render Breadcrumb */}
                    <Breadcrumbs title={props.t('Project')} breadcrumbItem={props.t('All Project')} />

                    <Row>
                        <Col lg="12">
                            <Card body className="text-center">

                                <div>
                                    <h1>Submit Project </h1>
                                    <Button color="primary" className="btn btn-primary waves-effect waves-light mx-2" >
                                        Submit Project
                                    </Button>
                                </div>


                            </Card>
                        </Col>
                    </Row>
                </Container>
            </div>
        </React.Fragment>
    )
}

export default withNamespaces()(SubmitProject)
